    <ContentBox className="w-100 h-a" title={"Términos y condiciones"} subtitle={"Su nueva identidad de marca."} />
    <ContentBox className="w-100 h-a" text={"adad"} />
   </div>
    </Fragment>
  
 
  )
}

export default Terms
